import React from 'react'
import '../styles/Github.css';
function Github() {
  
  const test = () => {
    console.log('test함수 실행');
  }

  return (
    <div className='github'>
      <div className='' mytest={() => test()}>git 페이지 입니다</div>
    </div>
  )
}

export default Github
